import axios from "axios";
import { useEffect, useState } from "react"

export default function Users(){


    const [users,Setusers]=useState([])

   
useEffect(()=> {
    fetch("http://127.0.0.1:8000/api/user/show")
    .then((res) =>res.json())
    .then((data)=> Setusers(data))
}, [users]);

function DeletUser(id){
        axios.delete(`http://127.0.0.1:8000/api/user/delete/${id}`);

    }


const DataShow = users.map((users,index) => (<tr key={index}>
    <td>{index +1}</td>
    <td>{users.name}</td>
    <td>{users.email}</td>
    <td><i onClick={()=>DeletUser(users.id)} className="fa-solid fa-trash" style={{color: "red" ,cursor:"pointer", paddingRight:"30px"}}></i>
    <i className="fa-solid fa-pen-to-square" style={{color: "#00ff11",cursor:"pointer"}}></i></td>


</tr>))
    return(<div style={{
        padding:"90px"
    }}>
        <table className="tabel">
            <thead>
                <th>Id</th>
                <th>Name</th>
                <th>Email</th>
                <th>Action</th>


            </thead>
            
            <tbody>
                {DataShow}
            </tbody>
        </table>
    </div>)
}
